    setSlideBarThree(false)
    setSlideBarTwo(false)
    setSlideBarFour(false)
    setSlideBarSix(false)

  }

  const [slideBarSix, setSlideBarSix] = useState(false)

  const slideBarActivFalseSix = () => 
  {

